import React from "react";
import { Container, Row, Col } from "react-bootstrap";
const FooterComponent = () => {
  return (
    <Container fluid>
      <Row>
        <Col className='bg-dark text-white text-center py-5'>
          Copyright &copy; Best Online Shop
        </Col>
      </Row>
    </Container>
  );
};

export default FooterComponent;
